import React, { Component } from 'react'
import {Route,Link} from 'react-router-dom'

export default class Cloth extends Component {
    render() {
        return (
            <div>
                THIS IS CLOTH PAGE

                <Link to="/cloth/men">MENS</Link>
                <Link to="/cloth/women">WOMENS</Link>
                <Link to="/cloth/kid">MENS</Link>

                <Route path="/cloth/men" render={()=> <Details name="mens"/>}/>
                <Route path="/cloth/women" render={()=> <Details name="womens"/>}/>
                <Route path="/cloth/kid" render={()=> <Details name="kids"/>}/>
            </div>
        )
    }
}

const Details=props=>{
    if(props.name==="mens")
    {
        alert("mens")
    }
    else if(props.name==="womens")
    {
        alert("mens")
    }
    if(props.name==="kids")
    {
        alert("kids")
    }

}
